import React from 'react';
import Home from './Home';
import About from './About';
import Blog from './Blog';
import './App.css'
import{Route,BrowserRouter as Router,Switch,Link} from 'react-router-dom';
function App(){
  return(
    <section id="nav">
<a>HariCharan</a>
<Router>
<a id='a2'><Link to='/Home' style={{textDecoration:'none',color:'black',marginLeft}}>Home</Link></a>
<a id='a3'><Link to='/About' style={{textDecoration:'none',color:'black'}}>About</Link></a>
<a id='a4'><Link to='/Blog' style={{textDecoration:'none',color:'black'}}>Blog</Link></a>
<br></br>
<Switch>
  <Route path="/Home" component={Home}/>
  <Route path="/About" exact component={About}/>
  <Route path="/Blog" component={Blog}/>
</Switch>
</Router>
</section>
  );
}
export default App;
